/**
 *
 * Wrapper
 *
 */

import styled from 'styled-components';

const Wrapper = styled.div`
  > .row {
    padding-left: 0;
    padding-right: 30px;
    .col-md-9 {
      padding-top: 18px;
    }
  }
`;

export default Wrapper;
